import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Breadcrumb from "../../src/NewBreadcrumb/index";
function Demo() {
  return (
    <div>
      <Router>
        <Route>
          <Breadcrumb
            goback={() => {
              console.log("goback");
            }}
            goforword={() => {
              console.log("goforword");
            }}
          />
        </Route>
      </Router>
    </div>
  );
}
export default Demo;
